function integer(e,t){return Math.floor(Math.random()*(t-e+1)+e)}function randomArrayIndex(e){return Math.floor(Math.random()*e)}function float(e,t,a){var n,r=Math.pow(10,a);n=integer(e*r,t*r);var d=(n/r).toFixed(a);return parseFloat(d)}function timeCodeString(e){var t=parseInt(e,10),a=Math.floor(t/3600),i=Math.floor((t-3600*a)/60),o=t-3600*a-60*i;return 10>a&&(a="0"+a),10>i&&(i="0"+i),10>o&&(o="0"+o),a+":"+i+":"+o}